import React from 'react';

const Frame10 = () => {
  return (
    <div
      style={{
        width: '1440px',
        height: '338px',
        background: 'rgba(28,38,76,1)',
        padding: '40px 70px',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame10 content goes here */}
      <div style={{ color: '#fff', fontSize: '32px', fontWeight: 600 }}>Frame10 Placeholder Left</div>
      <div style={{ color: '#fff', fontSize: '32px', fontWeight: 600 }}>Frame10 Placeholder Right</div>
    </div>
  );
};

export default Frame10;
